import { UsuarioContext, useUsuarioContext } from '../../contexts/Usuario';
import style from './header.module.css'

export default function Header() {

    

    return (

        <header className={`${style.header} bg-dark `}>
            <div className='bg-white text-dark' >
                <button onClick={(e) => {
                    e.preventDefault();
                    logout()
                }
                }>Logout</button>
            </div>

        </header >



    )
}
